import React, { useEffect, useState } from 'react';
import Style from '../Openings/Openings.module.css';
import { Heading } from '../Heading/Heading';
import { Button } from '../Button/Button';

export const Openings = () => {
  const [openingsJson, setOpeningsJson] = useState([]);
  const [openingIndex, setSelectedOpeningIndex] = useState(null);
  const [view, setView] = useState(false);

  const viewDetails = (openingIndex) => {
    setView(true);
    setSelectedOpeningIndex(openingIndex);
  }

  const backBtn = () => {
    setView(false);
  }

  useEffect(() => {
    fetchCallForDepartments();
  }, []);

  const fetchCallForDepartments = () => {
    fetch("http://localhost:8080/JobVista/GetOpenings", {
      method: 'GET',
      headers: {
        'Content-type': 'Application/JSON'
      }
    })
      .then(response => {
        if (!response.ok) {
          throw new Error(`HTTP error! Status: ${response.status}`);
        }
        return response.json();
      })
      .then(result => {
        console.log("Fetched data:", result);
        console.log("Departments:", result.message);
        setOpeningsJson(result.message);
      })
      .catch(error => {
        console.error('Error fetching data:', error);
      });
  }

  return (
    <div>
      <div>Openings</div>
      {!view ? (
      <table>
          <thead>
            <tr>
              <th>Opening Name</th>
              <th>Qualification</th>
              <th>Employment Type</th>
              <th>Salary Range</th>
              <th>Applicants</th>
              <th>Start_Date</th>
              <th>End_Date</th>
            </tr>
          </thead>
          <tbody>
            {openingsJson.map((openings, index) => (
              <tr key={index} onClick={() => viewDetails(index)}>
                <td>{openings.Description}</td>
                <td>{openings.Qualification}</td>
                <td>{openings.EmploymentType}</td>
                <td>{openings.SalaryRange}</td>
                <td>{openings.applicants.length}</td>
                <td>{openings.Start_Date}</td>
                <td>{openings.End_Date}</td>
              </tr>
            ))}
          </tbody>
        </table>
        ) : 
        (

        <div>
        {openingIndex !== null && (
          <div><Heading>{departmentJson[selectedDepartmentIndex].Name} Openings</Heading>
          <Button onClick={backBtn}>Back</Button>
  <table>
    <Button onClick={backBtn}>Back</Button>
    <thead>
      <tr>
        <th>Name</th>
        <th>Gender</th>
        <th>Email</th>
        <th>DOB</th>
        <th>Phone</th>
        <th>Qualification</th>
        <th>Experience</th>
      </tr>
    </thead>
    <tbody>
      {openingsJson[openingIndex].applicants.length > 0 ? (
        openingsJson[openingIndex].applicants.map((applicant, index) => (
          <tr key={index}>
            <td>{applicant.Name}</td>
            <td>{applicant.Gender}</td>
            <td>{applicant.Email}</td>
            <td>{applicant.DOB}</td>
            <td>{applicant.Phone}</td>
            <td>{applicant.Qualification}</td>
            <td>{applicant.Experience}</td>
          </tr>
        ))
      ) : (
        <tr>
          <td colSpan="7">No applicants found</td>
        </tr>
      )}
    </tbody>
  </table>
</div>
